The Andrea Tantaros Radio Show JUN-03-2013 MON









Obama Advisers Defend IRS Targeting Conservative Groups 


 The Andrea Tantaros Show


Published 3-Jun-2013 in TRN Central News


Obama advisers defend IRS targeting of conservative groups;

 Darrell Issa, Chairman of the House Oversight Committe,
     declares that not only was the targeting not the work of two rogue agents,
        but some have testified that the orders came from Washington D.C.;

 ALSO, IRS caught spending taxpayer money on lavish employee parties;



 All this and more on The Andrea Tantaros Show.
